<script>
import axios from "../../axios"
export default {
    name: "OutOfRegistrationPeriod",
    data() {
        return {
            message: `Zurzeit ist eine Spielgruppen Anmeldung nicht möglich, da die Anmeldezeit bereits vorbei ist oder noch nicht begonnen hat. Die nächste Anmeldemöglichkeit ist`,
            registration_phase_start_date: this.$route.params.registration_phase_start_date || null,
            registration_phase_end_date: this.$route.params.registration_phase_end_date || null
        }
    },

    mounted() {
        console.log(this.$route.params)
        if (!this.registration_phase_start_date && !this.registration_phase_end_date) {
            this.getRegistrationPeriodInfo()
        }
    },

    methods: {
        getRegistrationPeriodInfo() {
            axios.get(`/api/get-period-info/${this.$route.params.company_id}`).then(res => {
                this.registration_phase_start_date = res.data.upcoming_registration_start_date
                this.registration_phase_end_date = res.data.upcoming_registration_end_date
            }).catch(err => {
                this.$router.push({
                    name: "child-registration-error",
                })
            })
        },
    },
}
</script>

